CREATE DEFINER=`root`@`localhost` PROCEDURE `GenerateAttendanceLogs` ()   BEGIN
    DECLARE emp_id INT;
    DECLARE work_date DATE;
    DECLARE check_in_time TIME;
    DECLARE hours_worked INT;

    SET work_date = CURDATE() - INTERVAL 3 MONTH; -- Start date, 3 months back
    WHILE work_date <= CURDATE() DO
        -- Skip weekends
        IF WEEKDAY(work_date) < 5 THEN
            -- Loop through all employees
            SET emp_id = 1001;
            WHILE emp_id <= 1011 DO
                -- Random check-in time between 7:00 AM and 10:00 AM
                SET check_in_time = ADDTIME('07:00:00', SEC_TO_TIME(FLOOR(RAND() * 10800))); 

                -- Random hours worked between 5 and 10
                SET hours_worked = FLOOR(5 + (RAND() * 6));

                -- Insert attendance log
                VALUES (
                    emp_id, 
                    CONCAT(work_date, ' ', check_in_time), 
                    CONCAT(work_date, ' ', ADDTIME(check_in_time, SEC_TO_TIME(hours_worked * 3600)))
                );

                SET emp_id = emp_id + 1;
            END WHILE;
        END IF;

        -- Move to the next day
        SET work_date = work_date + INTERVAL 1 DAY;
    END WHILE;
END$$

